import React from 'react';
import {TextField,Dialog,DialogActions,DialogContent,DialogContentText,DialogTitle} from '@material-ui/core';

const test = (props) => {
  return (
    <div>
      {/* <p onClick = {props.click}>i am {props.name} and i am {props.age} years old!</p>
      <p>{props.children}</p> */}
      {/* <input type="text" value={props.name} onChange={props.changed} /> */}

      <TextField autoFocus margin="dense" id="email" value={props.passInput} label="Email Address"type="email" fullWidth onChange={props.echanged} />
      <br></br>
      <TextField margin="dense" id="password" value={props.passInput} label="Password" type="password" fullWidth onChange={props.pchanged} />
    </div>
  )
}

export default test;
